    {
		foreach ( $this->products as $value ) {
			$i = 0;
			$product = new Product();
			$product->store_id = $value[$i++];
			$product->id_catalog = $value[$i++];
			$product->vendor_id = $value[$i++];
			$product->product_model = $value[$i++];
			$product->product_url = $value[$i++];
			$product->product_name = $value[$i++];
			$product->ship_weight = $value[$i++];
			$product->product_master_category = $value[$i++];
			$product->product_category = $value[$i++];
			$product->product_sub_category = $value[$i++];
			$product->product_price = $value[$i++];
			$product->product_sale_price = $value[$i++];
			$product->product_thumb = $value[$i++];
			$product->batch_route_id = $value[$i++];
			$product->product_keywords = $value[$i++];
			$product->product_description = $value[$i++];
			$product->height = $value[$i++];
			$product->width = $value[$i++];
			$product->is_taxable = strtolower($value[$i++]) == "yes" ? 1 : 0;
			$product->is_deleted = $value[$i];
			$product->save();
		}
    }
